 (20,NULL,'ขอเอกสารเพิ่ม','สมศักดิ์ วลัยรัชต์','2014-05-30 22:05:32',NULL,'0000-00-00 00:00:00',1,298),
 (21,NULL,'ายละเอียดการเรียก service ตามเอกสารแนบมาครับ\r\n\r\nทดสอบแล้วสามารถเรียกโดย soapClient, NuSoap \r\n\r\nโดยในการเรียก service จะมี 2 service ให้เรียกคือ\r\n1. getSubjectList เพื่อ ดึงข้อมูลรหัสวิชาที่เปิดสอนในเทอมนั้น\r\nรูปแบบ เรียกโดย soapClient\r\n$result = $client->getSubjectList( $year, $semester, $faculty_id, $level, $dept_id); //* ดึงข้อมูลรหัสวิชา\r\n\r\nรูปแบบเรียกโดย NuSoap\r\n$result = $client->call(\'getSubjectList\', \r\narray(\r\n\'year\'=>$year, \r\n\'semester\'=>$semester, \r\n\'faculty_id\' => $faculty_id, \r\n\'level\'=>$level, \r\n\'dept_id\'=>$dept_id\r\n));	\r\n\r\n2. getTeachTable เพื่อ ดึงข้อมูลรายละเอียดตารางสอนรายวิชาที่เปิดสอน\r\nรูปแบบเรียกโดย soapClient\r\n$result = $client->getTeachTable($subject_id, $year, $semester, $faculty_id, $level, $dept_id); //ดึงข้อมูลตารางสอน\r\n\r\nรูปแบบเรียกโดย NuSoap\r\n$result = $client->call(\'getTeachTable\', \r\narray(\r\n\'subject_id\'=>$subject_id,\r\n\'year\'=>$year, \r\n\'semester\'=>$semester, \r\n\'faculty_id\' => $faculty_id, \r\n\'level\'=>$level, \r\n\'dept_id\'=>$dept_id\r\n));\r\n\r\n\r\n','พิทักษ์ ธรรมวาริน','2014-06-19 12:51:11',NULL,'0000-00-00 00:00:00',1,315),
