 (55,NULL,'Noobanjong, Koompong. (2013).  The Aesthetics of Power: Architecture, Modernity, and Identity from Siam to Thailand.  (Bangkok and Singapore: White Lotus Press).\r\nISBN : 9789744801975, 504 pp.\r\n\r\nThe Aesthetics of Power : Architecture, Identity and Modernity from Siam to Thailand comprehensively examines the politics of representation in architecture and urban space from the 1850s to the present time. By utilizing the built environment as a mode of problematization for studying the Thai national and cultural identity--known as Thainess or khwampenthai--this book offers a broader discourse and generates debate on the political forms of architecture as well as on the architectural forms of politics. Divided into seven chapters with more than 150 illustrations, it investigates a number of buildings and public spaces that signify various types of power and function in terms of media par excellence for the constructions of khwampenthei. Encompassing many palatial, government, public, and commercial structures, the inquiries also incorporate the ways in which these built forms have been subversively resemanticized by several contesting social agents to achieve their political objectives. An innovative synthesis of architectural history and critical studies on contemporary Thailand, the book not only brings a fresh understanding of complex Thai society but illustrates how Thais have appropriated modernity together with Western material culture in creating and transforming their modern identity.','คุ้มพงศ์  หนูบรรจง','2014-08-10 17:06:20',NULL,'0000-00-00 00:00:00',1,33),
 (56,NULL,'Noobanjong, Koompong. (2014).  “A Comparative Study on the Politics of Representation at Wat Benchama Bophit and Wat Phra Sri Mahathat, Bangkhen.” The 12th International Conference on Thai Studies.  April 22-14.  Southeast Asia Centre, University of Sydney, NSW, Australia. 17 pages.  Conference proceeding available online at: http://sydney.edu.au/southeast-asia-centre/documents/pdf/noobanjong-koompong.pdf.','คุ้มพงศ์  หนูบรรจง','2014-08-10 17:07:47',NULL,'0000-00-00 00:00:00',1,19),
 (57,NULL,'ประสพการณ์และความรู้ที่ได้รับจากการศึกษาดูงานด้านสถาปัตยกรรมและการออกแบบในประเทศฟินแลนด์ ในครั้งนี้  ได้ถูกนำมาบูรณาการเข้ากับการค้นคว้าวิจัย เป็นผลลัพท์ออกมในลักษณะของบทความวิจัย เรื่อง The Senate Square (Senaatintori): Helsinki’s Urban Palimpsest ซึ่งได้ถูกตอบรับให้นำเสนอต่อที่ประชุมวิชาการนานาชาติ Spaces and Flows: The 6th International Conference on Urban and Extra Urban Studies.  โดยมีกำหนดการจัดประชุมระหว่างวันที่ 15-16 ตุลาคม พ.ศ.​ 2558 ณ. University Center Chicago เมือง Chicago ประเทศสหรัฐอเมริกา','คุ้มพงศ์  หนูบรรจง','2014-08-10 17:20:48',NULL,'0000-00-00 00:00:00',1,22),
 (58,NULL,'ปฏิบัติหน้าที่รองประธานสาขาวิชาครุศาสตร์สถาปัตยกรรมและการออกแบบฝ่ายวางแผนและบริหาร \r\nในการช่วยกำกับดูแลงานด้าน: 1) การวางแผน; 2) การบริหารความเสี่ยง; 3) การพัฒนาบุคคลากร; \r\n4) งานช่วยอำนวยการบริหาร; และ 5) การประกันคุณภาพการศึกษาของสาขาวิชาฯ (ตั้งแต่ พ.ศ.​ 2554 - ปัจจุบัน)  \r\n','คุ้มพงศ์  หนูบรรจง','2014-08-10 17:27:05',NULL,'0000-00-00 00:00:00',1,28),
 (59,NULL,'นักศึกษาปริญญาเอกสาขาวิชาครุศาสตร์อุตสาหกรรม หลักสูตรครุศาสตร์ อุตสาหกรรมดุษฎีบัณฑิต แขนงการศึกษาสถาปัตยกรรมและการออกแบบ  คณะครุศาสตร์อุตสาหกรรม  ที่เข้าร่วมการศึกษาดูงานด้านการศึกษาสถาปัตยกรรม การออกแบบ และไทยคดีศึกษา ณ. นครซิดนีย์ เครือรัฐออสเตรเลีย ระหว่างวันที่ 19-28 เมษายน พ.ศ.​ 2557 ที่ผ่านมานั้น  ได้กลับมาจัดการสัมมนาเรื่อง การทำนุบำรุงศิลปวัฒนธรรมแบบบูรณาการ โดยสาขาวิชาครุศาสตร์สถาปัตยกรรมและการออกแบบ คณะครุศาสตร์อุตสาหกรรม สถาบันเทคโนโลยีพระจอมเกล้าเจ้าคุณทหารลาดกระบัง เมื่อวันที่ 31 กรกฎาคม พ.ศ. 2557\r\n','คุ้มพงศ์  หนูบรรจง','2014-08-10 17:34:33',NULL,'0000-00-00 00:00:00',1,21),
